import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const cardStyle = {
    margin: "8px",
    width: '18rem',
    textColor: "black"
};

const buttonStyle = {
    justifyContent: "center"
};

function About() {
    return (
        <Card style={cardStyle}>
            <Card.Img variant="top" src="https://s1.1zoom.ru/big0/187/302174-Berserker.jpg" />
            <Card.Body>
                <Card.Title>Freightliner Truck</Card.Title>
                <Card.Text>
                    Cost: 50 000$
                </Card.Text>
                <Button variant="theme float-right" style={{alignContent: "center"}}>Go somewhere</Button>
            </Card.Body>
        </Card>
    );
}

export default About;
